import React from 'react'

const Exercicio1 = () => {

const nomes = ['Alice', 'Bob', 'Carol', 'David'];
  {nomes.map((item, index) => (
    <div key={index}>
      <li>
        {item}
      </li>
    </div>
  ))
  }

  return (
    <div>
      <h1>Exercicio1</h1>
    </div>
  )
}

export default Exercicio1
